angular.module("AngularApp").run(["$templateCache",function(e){e.put("checkout/checkout.html",'<section class="basket-empty" ng-if="checkoutVm.basket.items.length === 0">\r\n    <h2>Nothing to Checkout!!</h2>\r\n    There are no items in basket. Click <a ui-sref="main">here</a> to shop.\r\n</section>\r\n\r\n<section class="checkout" ng-if="checkoutVm.basket.items.length > 0">\r\n    <section class="manage-items">\r\n        <h2>\r\n            Shopping Bag\r\n        </h2>\r\n\r\n        <div class="basket-items">\r\n            <ul>\r\n                <li ng-repeat="item in checkoutVm.basket.items">\r\n                    <div class="item" layout="row" layout-align="center center">\r\n                        <div flex="66" flex-sm="55">\r\n                            <span class="name">{{ item.name }}</span>\r\n                        </div>\r\n                        <div class="quantity-container" flex>\r\n                        <span class="add-button-container" ng-click="checkoutVm.basket.removeItem(item)"><i\r\n                                class="fa fa-minus"></i></span>\r\n\r\n                            <span>{{ item.quantity }}</span>\r\n                        <span class="add-button-container" ng-click="checkoutVm.basket.addItem(item)"><i\r\n                                class="fa fa-plus"></i></span>\r\n                        </div>\r\n                        <span class="price" flex="20" flex-gt-sm="10">{{ item.price * item.quantity | currency : \'£\' : 2}}</span>\r\n                    </div>\r\n                </li>\r\n            </ul>\r\n            <div class="total" layout="row" layout-align="end center">\r\n                <span class="price" flex="20" flex-gt-sm="10">{{ checkoutVm.basket.getBasketValue() | currency : \'£\' : 2 }}</span>\r\n            </div>\r\n        </div>\r\n    </section>\r\n\r\n    <section class="delivery-method">\r\n        <h2>Delivery Instructions</h2>\r\n\r\n        <h3>Select Delivery Method:</h3>\r\n        <select name="delivery" id="delivery" ng-model="checkoutVm.selectedDeliveryMethod"\r\n                ng-options="method.name for method in checkoutVm.deliveryMethods"></select>\r\n\r\n        <div class="selected-method" layout="row" layout-align="end center">\r\n            <span class="text" flex>Delivery Cost:</span>\r\n            <span class="price" flex="20" flex-gt-sm="10">{{ checkoutVm.selectedDeliveryMethod.price | currency : \'£\' : 2 }}</span>\r\n        </div>\r\n\r\n    </section>\r\n    <section class="confirmation">\r\n        <h2>Confirmation</h2>\r\n\r\n        <div class="amount-to-pay" layout="row" layout-align="end center">\r\n            <span class="text" flex>Amount to Pay:</span>\r\n            <span class="price" flex="20" flex-gt-sm="10">{{ checkoutVm.totalCost() | currency : \'£\' : 2 }}</span>\r\n        </div>\r\n\r\n        <div class="submit">\r\n            <md-button class="md-raised md-primary" ng-click="checkoutVm.submitOrder()">Submit</md-button>\r\n        </div>\r\n\r\n    </section>\r\n</section>'),e.put("checkout/orderConfirmation.html",'<div class="acknowledgement">\r\n    <h2>Thank You!</h2>\r\n    <p class="message">Your order <span class="order-number">{{ orderConfirmationVm.order.orderNumber }}</span> has been placed successfully. A confirmation email has also been sent to your registered email address for your reference.</p>\r\n</div>\r\n\r\n'),e.put("main/main.html",'<div class="shopping-items">\r\n    <ul>\r\n        <li ng-repeat="item in mainVm.shopItems">\r\n            <div layout="row" layout-align="center center">\r\n                <span class="name" flex>{{ item.name }}</span>\r\n                <span class="price">{{ item.price | currency : \'£\' : 2 }}</span>\r\n                <span class="add-button-container" ng-click="mainVm.addItemToBasket(item)"><i class="fa fa-plus"></i></span>\r\n            </div>\r\n        </li>\r\n    </ul>\r\n</div>'),e.put("components/BasketBadge/BasketBadge.html",'<div class="basket-badge">\r\n    <a ui-sref="checkout">\r\n        <span><i class="fa fa-shopping-cart fa-2x"></i></span>\r\n        <span class="basket-text">Basket:</span>\r\n        <span class="item-count"> {{ basketBadgeVm.basket.getItemCount() }} items</span>\r\n    </a>\r\n</div>'),e.put("components/NavBar/NavBar.html",'<header class="navbar">\r\n    <div class="container" layout="row" layout-sm="column">\r\n        <div class="navbar-header clearfix" layout="row" flex>\r\n            <h1 flex><a ui-sref="main">AJ Store</a></h1>\r\n            <aj-basket-badge></aj-basket-badge>\r\n        </div>\r\n    </div>\r\n</header>')}]);